import React from 'react';
import { FaqQuestion } from './Faqapi';
import './Faq.css';

const Faq = () => {
    const [Faq, setFaq] = useState(FaqQuestion);
    return (
        <>
        {
           Faq.map((CurrentFaq)=>{
            return CurrentFaq
           })
        } 
        </>
    )
}

export default Faq
